import logo from './logo.svg';
import './App.css';
import Profile from './Pages/Profile'
import Home from './Pages/Home'
import About from './Pages/About'
import Contact from './Pages/Contact'
import Admin from './Pages/Admin'
import { BrowserRouter, NavLink, Route, Routes } from 'react-router-dom';
import { useState } from 'react';
function App() {
  const isActive = {
    color
  };
  const [notLogin,Login] = useState(0)
  return (
    <div className='App'>

        <BrowserRouter>
        <Routes>
            <Route exact path="/profile/:id" element={<Profile/>}/>
            <Route path='/home' element={<Home Login={Login}/>}/>
            <Route path='/about' element={<About/>}/>
            <Route path='/contact' element={<Contact/>}/>
            <Route path='/admin' element={notLogin === 1 && <Admin Login={Login} />}/>
          </Routes>
          <nav>
            <NavLink to={"/home"}>Home</NavLink>
            <NavLink to={"/about"}>About</NavLink>
            <NavLink to={"/contact"}>Contact</NavLink>
            <NavLink activeStyle={isActive} to={'/profile/'}>Profile</NavLink>
            <NavLink  to={'/admin'}>For Admin</NavLink>
          </nav> 
        </BrowserRouter>
    </div>


  );
}

export default App;
